import React, {Component} from 'react';

export default class Form extends Component{
	render(){
		return(
			<div>
				<form>
					Title: <input type='text' id='titleForm' /><br/>
					Description <input type='text' id='descForm' /><br/>
					Date Posted <input type='date' id='dateForm' /><br/>	
				</form>
			</div>
		)
	}
}
